import React, { useState } from 'react';
import { Box, Typography, Grid, Card, CardContent, Button, TextField } from '@mui/material';

const MonthlyPrice = () => {
  const [location, setLocation] = useState('');
  const [price, setPrice] = useState({
    lunch: 3000,
    dinner: 1800,
    lunchDinner: 5000,
    oneDay: 70,
  });

  const ownerNumber = '+91 9876543210'; // Replace with the actual owner's number

  // Handle price change based on location
  const handleLocationChange = (event) => {
    setLocation(event.target.value);
    adjustPrices(event.target.value);
  };

  // Adjust prices based on location
  const adjustPrices = (location) => {
    if (location === 'Mumbai') {
      setPrice({
        lunch: 3500,
        dinner: 2000,
        lunchDinner: 5500,
        oneDay: 80,
      });
    } else if (location === 'Delhi') {
      setPrice({
        lunch: 3000,
        dinner: 1800,
        lunchDinner: 5000,
        oneDay: 70,
      });
    } else if (location === 'Bangalore') {
      setPrice({
        lunch: 3200,
        dinner: 1900,
        lunchDinner: 5100,
        oneDay: 75,
      });
    } else {
      setPrice({
        lunch: 3000,
        dinner: 1800,
        lunchDinner: 5000,
        oneDay: 70,
      });
    }
  };

  const handleLocationSearch = () => {
    window.open('https://www.google.com/maps', '_blank'); // Opens Google Maps for location search
  };

  return (
    <Box sx={{ padding: '2rem', textAlign: 'center' }}>
      <Typography variant="h4" gutterBottom>
        Monthly Pricing
      </Typography>

      <TextField
        label="Enter Your Location"
        variant="outlined"
        fullWidth
        sx={{ marginBottom: '2rem', maxWidth: '400px', margin: '0 auto' }}
        onChange={handleLocationChange}
        value={location}
      />

      <Grid container spacing={4} justifyContent="center" sx={{ marginTop: '2rem' }}>
        <Grid item xs={12} sm={6} md={4}>
          <Card>
            <CardContent>
              <Typography variant="h5" gutterBottom>
                Lunch
              </Typography>
              <Typography variant="body1">Price: ₹{price.lunch}</Typography>
            </CardContent>
          </Card>
        </Grid>
        <Grid item xs={12} sm={6} md={4}>
          <Card>
            <CardContent>
              <Typography variant="h5" gutterBottom>
                Dinner
              </Typography>
              <Typography variant="body1">Price: ₹{price.dinner}</Typography>
            </CardContent>
          </Card>
        </Grid>
        <Grid item xs={12} sm={6} md={4}>
          <Card>
            <CardContent>
              <Typography variant="h5" gutterBottom>
                Lunch + Dinner
              </Typography>
              <Typography variant="body1">Price: ₹{price.lunchDinner}</Typography>
            </CardContent>
          </Card>
        </Grid>
        <Grid item xs={12} sm={6} md={4}>
          <Card>
            <CardContent>
              <Typography variant="h5" gutterBottom>
                One-Day Price
              </Typography>
              <Typography variant="body1">Price: ₹{price.oneDay}</Typography>
              <Typography variant="body2" color="text.secondary">
                (Choose either Lunch or Dinner for a single day)
              </Typography>
            </CardContent>
          </Card>
        </Grid>
      </Grid>

      <Box sx={{ marginTop: '2rem' }}>
        <Typography variant="h6" gutterBottom>
          Owner Contact: <a href={`tel:${ownerNumber}`}>{ownerNumber}</a>
        </Typography>
        <Button 
          variant="contained" 
          color="primary" 
          onClick={handleLocationSearch}
          sx={{ marginTop: '1rem' }}
        >
          Search Location
        </Button>
      </Box>
    </Box>
  );
};

export default MonthlyPrice;
